// XXX So deprecated, it would make your head spin
//
// The old stat structure.  In fact, this is not used by the kernel at all,
// and should not be used by user space, and should be removed from this
// header file entirely (along with the unused cvtstat() prototype in
// vnode_internal.h).
type ostat = struct {
	st_dev       uint16
	_            [6]byte
	st_ino       ino_t
	st_mode      mode_t
	st_nlink     nlink_t
	st_uid       uint16
	st_gid       uint16
	st_rdev      uint16
	_            [2]byte
	st_size      int32
	st_atimespec struct {
		tv_sec  int64
		tv_nsec int64
	}
	st_mtimespec struct {
		tv_sec  int64
		tv_nsec int64
	}
	st_ctimespec struct {
		tv_sec  int64
		tv_nsec int64
	}
	st_blksize int32
	st_blocks  int32
	st_flags   uint32
	st_gen     uint32
} /* stat.h:110:1 */

