// Constants and structures defined by the internet system,
// Per RFC 790, September 1981, and numerous additions.

// Protocols (RFC 1700)
// 55-57: Unassigned
// 101-252: Partly Unassigned
// 253-254: Experimentation and testing; 255: Reserved (RFC3692)
// BSD Private, local use, namespace incursion

// last return value of *_input(), meaning "all job for this pkt is done".

// Local port number conventions:
//
// When a user does a bind(2) or connect(2) with a port number of zero,
// a non-conflicting local port address is chosen.
// The default range is IPPORT_RESERVED through
// IPPORT_USERRESERVED, although that is settable by sysctl.
//
// A user may set the IPPROTO_IP option IP_PORTRANGE to change this
// default assignment range.
//
// The value IP_PORTRANGE_DEFAULT causes the default behavior.
//
// The value IP_PORTRANGE_HIGH changes the range of candidate port numbers
// into the "high" range.  These are reserved for client outbound connections
// which do not want to be filtered by any firewalls.
//
// The value IP_PORTRANGE_LOW changes the range to the "low" are
// that is (by convention) restricted to privileged processes.  This
// convention is based on "vouchsafe" principles only.  It is only secure
// if you trust the remote host to restrict these ports.
//
// The default range of ports and the high range can be changed by
// sysctl(3).  (net.inet.ip.port{hi,low}{first,last}_auto)
//
// Changing those values has bad security implications if you are
// using a a stateless firewall that is allowing packets outside of that
// range in order to allow transparent outgoing connections.
//
// Such a firewall configuration will generally depend on the use of these
// default values.  If you change them, you may find your Security
// Administrator looking for you with a heavy object.
//
// For a slightly more orthodox text view on this:
//
//            ftp://ftp.isi.edu/in-notes/iana/assignments/port-numbers
//
//    port numbers are divided into three ranges:
//
//                0 -  1023 Well Known Ports
//             1024 - 49151 Registered Ports
//            49152 - 65535 Dynamic and/or Private Ports
//

// Ports < IPPORT_RESERVED are reserved for
// privileged processes (e.g. root).         (IP_PORTRANGE_LOW)
// Ports > IPPORT_USERRESERVED are reserved
// for servers, not necessarily privileged.  (IP_PORTRANGE_DEFAULT)

// Default local port range to use by setting IP_PORTRANGE_HIGH

// Scanning for a free reserved port return a value below IPPORT_RESERVED,
// but higher than IPPORT_RESERVEDSTART.  Traditionally the start value was
// 512, but that conflicts with some well-known-services that firewalls may
// have a fit if we use.

// Internet address (a structure for historical reasons)
type in_addr = struct{ s_addr in_addr_t } /* in.h:301:1 */

// Definitions of bits in internet address integers.
// On subnets, the decomposition of addresses to host and net parts
// is done according to subnet mask, not the masks here.

// Socket address, internet style.
type sockaddr_in = struct {
	sin_len    uint8
	sin_family sa_family_t
	sin_port   in_port_t
	sin_addr   struct{ s_addr in_addr_t }
	sin_zero   [8]int8
} /* in.h:375:1 */

// Structure used to describe IP options.
// Used to store options internally, to pass them to a process,
// or to restore options retrieved earlier.
// The ip_dst is used for the first-hop gateway when using a source route
// (this gets put into the header proper).
type ip_opts = struct {
	ip_dst  struct{ s_addr in_addr_t }
	ip_opts [40]int8
} /* in.h:398:1 */

// Options for use with [gs]etsockopt at the IP level.
// First word of comment is data type; bool is stored in int.
// for IPSEC

// These older firewall socket option codes are maintained for backward compatibility.

// IPv4 Source Filter Multicast API [RFC3678]

// The following option is private; do not use it from user applications.

// Protocol Independent Multicast API [RFC3678]

// Defaults and limits for options

// The imo_membership vector for each socket is now dynamically allocated at
// run-time, bounded by USHRT_MAX, and is reallocated when needed, sized
// according to a power-of-two increment.

// Default resource limits for IPv4 multicast source filtering.
// These may be modified by sysctl.

// Argument structure for IP_ADD_MEMBERSHIP and IP_DROP_MEMBERSHIP.
type ip_mreq = struct {
	imr_multiaddr struct{ s_addr in_addr_t }
	imr_interface struct{ s_addr in_addr_t }
} /* in.h:507:1 */

// Modified argument structure for IP_MULTICAST_IF, obtained from Linux.
